import React from 'react'

export default function Todo() {
    return (
        <div>
             <h1>Todo  ka oage</h1>
             <div class="nav justify-content-end" class="navbar navbar-dark bg-primary">
                <li class="nav-item">
                    <a class="nav-link active" aria-current="page" href="#">Active</a>
                </li>
            </div>
        </div>
    )
}
